import axios from 'axios';
import React, { useEffect } from 'react';

const FetchPolicyNames = () => {
  const [userEmail, setuserEmail] = useState('');

  useEffect(() => {
    const storeduserEmail = localStorage.getItem('userEmail');
    if (storeduserEmail) {
      setuserEmail(storeduserEmail);
    }

    const fetchPolicies = async () => {
      try {
        const response = await axios.get(`http://localhost:8080/admin/check/${userEmail}`, {
        headers: {
          'Content-Type': 'application/json',
        },
        withCredentials: true,
      });
        console.log(response.data);
      } catch (error) {
        console.error('There was an error fetching the policies!', error);
      }
    };

    fetchPolicies();
  }, []);

  return <div>Check the console for the list of policies.</div>;
};

export default FetchPolicyNames;
